import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { CloudUpload } from '@mui/icons-material';
import { Button, Typography, Box } from '@mui/material';
import { useTheme } from '@mui/material/styles';
import '../styles/styles.css';

const Dashboard = () => {
  const [files] = useState([]);
  const theme = useTheme();

  return (
    <Box sx={{ textAlign: 'center', padding: theme.spacing(4) }}>
      <Typography variant="h1" sx={{ marginBottom: theme.spacing(2) }}>
        Welcome to Storify
      </Typography>
      <Typography variant="h2" sx={{ marginBottom: theme.spacing(4) }}>
        {files.length === 0 
          ? "Upload, organize and access your files from anywhere." 
          : `You have ${files.length} file${files.length !== 1 ? 's' : ''} uploaded`}
      </Typography>
      <Link to="/upload" style={{ textDecoration: 'none' }}>
        <Button variant="contained" color="primary" startIcon={<CloudUpload />}>
          Start Uploading
        </Button>
      </Link>
      {files.length > 0 && (
        <Box sx={{ marginTop: theme.spacing(4) }}>
          {files.map(file => (
            <Box key={file.id} sx={{ display: 'flex', justifyContent: 'space-between', marginBottom: theme.spacing(1) }}>
              <span>{file.name}</span>
              <Button variant="outlined" color="secondary">Delete</Button>
            </Box>
          ))}
        </Box>
      )}
    </Box>
  );
};

export default Dashboard;
